def get_file(path):
    file_list=[]
    files=os.listdir(path)
    for i in range(len(files)):
        if '.' in files[i]:
            name=files[i].split('.')[0]
            file_list.append(name)
        else:
            # print("it is folder")
            continue
    return file_list

